import { Outlet, Navigate } from 'react-router-dom';
import { LoginContextConsumer } from '../LoginContext';
export default function PrivateRoutes(){
    return(
        <LoginContextConsumer>
            {
                (value)=>{
                    return (renderPrivateRoutes(value))
                }
            }
        </LoginContextConsumer>
    );
}
function renderPrivateRoutes(value){
    let auth=value.userDetails.isLoggedIn;
    console.log("privateRoutes: "+auth);
    return(
        auth ? <Outlet/> : <Navigate to="/sonicLibrarySystem/" replace />
    );
}
